import Header from './../components/Header'
import Bottom from './../components/Bottom'

class NotFound extends React.Component{

    render(){

        return(
            <div>
                <Header/>
                <h1 style={{"textAlign":"center"}}>404<small>您的资源消失了</small></h1>
                <Bottom/>
            </div>
        )
    }
}

export default NotFound
